column47:
HM Government of Gibraltar intends to obtain expressions of interests from service providers for the following works under this Project:

The Design, Build, Finance and Operation (DBFO) of an UWWTP, including an outfall where relevant, in Gibraltar. On satisfactory completion of the Design, Build and Finance phase, an Operation and Maintenance (O&M) period of 20 years will commence. 
Interested parties will be able to apply through HM Government of Gibraltar Supplier Network Portal https://hmgogsupplier.gibraltar.gov.gi 

Once registered on the aforementioned portal interested parties will be able to download the information available and submit their interest by the 31st October 2022 12 noon deadline.

The following general criteria will be taken into account in assessing the EOIs submitted. Additional criteria may be included in later stages of the process. 

1.	Technical, operational, managerial, commercial and financial expertise and ability to ensure the successful delivery of the project;
2.	The nature, type, style and appearance of the facility that the proponent will be offering;
3.	Proposed operating fees;
4.	Construction and operational environmental management plan and policy for the facility;
5.	Company and directors track record;
6.	Completion time for the construction and commissioning of the Works.

Further details are available in the full version of the request for expressions of interest attached and on the Supplier Network Portal https://hmgogsupplier.gibraltar.gov.gi

Additional information: Gibraltar does not participate in the Agreement on Government Procurement (GPA) under the World Trade Organization (WTO). HMGoG therefore reserves the right to consider only those responses from eligible organisations in Gibraltar, the UK, or a country or territory covered by a trade agreement extending to Gibraltar that contains relevant procurement provisions.
